body {

  background: #fff;

}

header {
  padding-left: 8px;
  border-left: 20px solid #0077d6;
}

button {
  padding: 1px;
  margin: 4px;
  background: #fff;
  border: 1px solid #0003;
  border-radius: 4px;
}

button:hover {
  background: #fefefe;
  border-color: #0006;
}

button:active {
  background: #d0d0d0;
  border-color: #0006;
}

#root {
  min-width: 320px;
  max-width: 980px;
  padding: 10px 2px;
  margin: 0 auto;
}

.graph {
  text-align: right;
}

.graph-info {
  display: inline-block;
  padding: 0 2px;
  font-size: 90%;
  background: #eee;
  border: 2px solid #333;
  border-bottom-width: 0;
  border-radius: 6px 6px 0 0;

.graph-canvas {

  width: 100%;

  border: 2px solid #333;
}

.graph-menu {
  padding: 0 2px;
  text-align: left;
  background: #eee;
  border: 2px solid #333;
  border-top-width: 0;
  border-radius: 0 0 6px 6px;
}

.graph-mode {

  margin-left: 10px;
  font-size: 90%;
  background: #bdd8ff;
  border-left: 10px solid #579bff;
}

.notes {
  margin-top: 10px;
  border-top: 1px solid #333;
}

.notes-menu {
  text-align: right;
}

.note {
  padding: 0 10px;
  margin-bottom: 10px;
  background: #eee;
  border: 2px solid #333;
  border-radius: 12px;
}

.note-header {
  float: left;
  padding-left: 6px;
  border-left: 10px solid;
}

.note-footer {
  float: left;
  margin: 4px 0 0 6px;
}

.note-content {
  display: block;
  width: 100%;
  padding: 4px;
  overflow-y: hidden;
  overflow-wrap: break-word;
  resize: none;
  border: solid 1px #555;
  border-radius: 4px;
  box-shadow: 1px 1px #bbb;
  font-size: 20px;
  line-height: 26px;
}

.note-menu {
  text-align: right;
}

.new {
  padding: 20px;
  text-align: center;
  background: #80cfff;
}

.name-entry {
  padding: 6px;
  margin-top: 10px;
  border-top: 1px solid #333;
}

.name-form {
  display: flex;
  padding-left: 8px;
  margin-top: 4px;
}

.name-form > label {
  display: flex;
  flex-grow: 1;
  margin-right: 16px;
}

.name-form > label > input {
  flex-grow: 1;
  margin-left: 4px;
}

.download {
  display: block;
  margin: 0 auto;
}
